[BITS 64]
[DEFAULT REL]

%include "../jd9999_hdr_macro.inc"
jd9999_hdr_macro textsize, datasize, 0x0, textsize+datasize+1024

%macro print 1
	mov rcx, qword [EFI_SYSTEM_TABLE]
	mov rcx, qword [rcx+64]
	lea rdx, [%1]
	sub rsp, 32
	call [efi_print]
	add rsp, 32
%endmacro

%macro getch 1
	mov rcx, qword [EFI_SYSTEM_TABLE]
	mov rcx, qword [rcx+48]
	lea rdx, [%1]
	call [efi_getch]
%endmacro




section .text follows=.header
start:
	sub rsp, 6*8+8 ; Copied from Charles AP's implementation, fix stack alignment issue (Thanks Charles AP!)

	mov qword [EFI_HANDLE], rcx
	mov qword [EFI_SYSTEM_TABLE], rdx

	mov rax, qword [EFI_SYSTEM_TABLE]
	mov rax, qword [rax+64]
	mov rax, qword [rax+8]
	mov qword [efi_print], rax

	mov rax, qword [EFI_SYSTEM_TABLE]
	mov rax, qword [rax+48]
	mov rax, qword [rax+8]
	mov qword [efi_getch], rax


	call get_MADT_BAR
	call conf_LAPIC
	call disable_PIC

	call sse_en
	;call avx_en

	cli
	mov rax, 1000
	lea rbx, [intfunc]
	xor rcx, rcx
	mov rdx, 0x22
	call init_hpet
	sti


	xor rax, rax
	xor rbx, rbx
	xor rcx, rcx
	xor rdx, rdx
	xor rsi, rsi
	xor rdi, rdi
	xor rbp, rbp
	xor r8, r8
	xor r9, r9
	xor r10, r10
	xor r11, r11
	xor r12, r12
	xor r13, r13
	xor r14, r14
	xor r15, r15

	_loop:
		mov rax, qword [counter]
		mov qword [start_count], rax

		lea rdi, [numarr]
		mov rsi, 50000
		call bench_start

		mov rax, qword [counter]
		sub rax, qword [start_count]
		lea rbx, [timesarr]
		mov rcx, qword [iter]
		shl rcx, 3
		mov qword [rbx+rcx], rax

		mov rax, qword [iter]
		lea rdi, [tststr+34]
		call cvt2hex
		print tststr

		inc qword [iter]
		cmp qword [iter], 100
	jnz _loop


	call get_PCIe_BAR
	call probe_AHCI
	mov rax, 0
	mov rcx, 1
	lea rsi, [timesarr]
	call AHCI_write

	cli
	hlt

	%include "../HPET_driver/HPET_driver_generic.inc"
	%include "../MADT/MADT.inc"
	%include "../ioapic/ioapic.inc"
	%include "../apic/apic.inc"
	%include "../IDT/IDT.inc"	
	%include "../cvt2hex/cvt2hex.inc"
	%include "../AHCI/AHCI.inc"
	%include "../PCIe/PCIe.inc"


	intfunc:
		inc qword [counter]
		;push rax
		mov qword [timerstash], rax
		mov rax, 0xFEE000B0
		mov dword [rax], 0
		;pop rax
		mov rax, qword [timerstash]
	iretq

	; rax - amount of miliseconds
	sleep:
		add rax, qword [counter]
		._loop:
			pause
			cmp rax, qword [counter]
		jnz ._loop
	ret

	sse_en:
		mov rax, cr0
		and ax, 0xFFFB
		or ax, 0x2
		mov cr0, rax
		mov rax, cr4
		or ax, 3<<9
		mov cr4, rax
	ret

	avx_en:
		xor rcx, rcx
		xgetbv
		or eax, 7
		xsetbv
	ret


